function privilegioService(){var t=new jsConnector;this.addPrivilegio=function(e,i){try{t.post(url.privilegio.add,e,function(e){null!=e?(successMessage({title:message.privilegio.add.title,content:message.privilegio.add.success}),i(e)):errorMessage({title:message.privilegio.add.title,content:message.privilegio.add.error})})}catch(e){console.log(e)}},this.updatePrivilegio=function(e,i){try{t.post(url.privilegio.update,e,function(e){null!=e&&1===e?(successMessage({title:message.privilegio.update.title,content:message.privilegio.update.success}),i(e)):errorMessage({title:message.privilegio.update.title,content:message.privilegio.update.error})})}catch(e){console.log(e)}},this.deletePrivilegio=function(e,i){try{t.post(url.privilegio.delete,e,function(e){null!=e&&1===e?(successMessage({title:message.privilegio.delete.title,content:message.privilegio.delete.success}),i(e)):errorMessage({title:message.privilegio.delete.title,content:message.privilegio.delete.error})})}catch(e){console.log(e)}},this.listPrivilegio=function(i){try{t.post(url.privilegio.list,JSON.stringify({id:1}),function(e){null!=e&&0<e.length?i(e):infoMessage({title:message.privilegio.list.title,content:message.privilegio.list.empty})})}catch(e){console.log(e)}}}